import axios from "@/axios";

export default {
    state: {
        orders: [],
    },
    getters: {
        getOrders: (state) => state.orders,
    },
    mutations: {
        SUBMIT_ORDER: (state, order) => {
            state.orders.push(order);
        },
    },
    actions: {
        placeOrder: async({ commit }, order) => {
            console.log(order);
            const res = await axios.post("orders", JSON.stringify(order));

            if (res.status === 200) {
                console.log(res.data);
                commit("SUBMIT_ORDER", res.data);
                return res.data;
            }
        },
    },
};
